const GameBoard = (props) => {

    function makeCircleEnemy(health, attack, speed, armor) {
        console.log(health, attack, speed, armor)
        props.createCircleEnemy(health, attack, speed, armor)
    }

        return (
            <nav>
            <div>
                <h2>This Is The GameBoard Room One</h2>
                <h5>It is the first "bonfire"</h5>
                <h2>Change-----------Here</h2>
            </div>
            <h1>this is the homepage</h1>
            <ul>
                <li>
                    <Link to="/RoomTwo" >
                        <button className="circle" onClick={() => makeCircleEnemy(20, 2, 0, 1)}>Go to room Two</button>
                    </Link>
                </li>
            </ul>
            <div>
                <img src={GameRoomOnePNG} alt="GameRoomOnePNG" />
            </div>
            </nav>
        )
    }


export default GameBoard;
